import './Codelock.css';

const Codelock = () => {
    const buttons = [];

    for (let i = 0; i < 9; i++) {
        buttons.push(<div>+</div>)
    }

    const button = (btnNumber) => {
        return (
            <div className="button">
                <p>{btnNumber}</p>
            </div>
        )
    }
    return (
        <div className="codelock-container">
            {
                buttons.map((item, id) => {
                    <div>{item}</div>
                })
            }
        </div>
    )
}

export default Codelock
